// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;
import "./Auction.sol";

contract TestAuction is Auction {
    uint256 time;

    constructor(
        address payable _seller,
        uint _energyAmount, 
        uint _minBidValue, 
        uint _depositValue,
        uint _deadline
    ) Auction (
        _seller,
        _energyAmount, 
        _minBidValue, 
        _depositValue,
        _deadline
    ) {}

    function currentTime() internal view override returns (uint256) {
        return time;
    }

    function setCurrentTime(uint256 newTime) public {
        time = newTime;
    }

    function setCurrentState(State newState) public {
        auctionInfo.currentState = newState;
    }

    function testFindWinner() public {
        findWinner();
    }

    function testTransferBackDeposits() public {
        transferBackDeposits();
    }

    function testTransferHighestBidToSeller() public {
        transferHighestBidToSeller();
    }
}
